import React, { useState, useEffect } from 'react';

function Profile() {
  const [userInfo, setUserInfo] = useState(null);

  useEffect(() => {
    const userInfoString = localStorage.getItem('loggedInUser'); // Retrieve user info from localStorage
    if (userInfoString) {
      setUserInfo(userInfoString); // No need to parse it if it's a plain string
    }
  }, []);

  return (
    <div className="profile-page">
      <h1>Profile Page</h1>
      {userInfo ? (
        <div>
          <p><strong>Username:</strong> {userInfo}</p> {/* Display the username directly */}
          {/* Add more user details here */}
        </div>
      ) : (
        <p>No user information available. Please log in.</p>
      )}
    </div>
  );
}

export default Profile;
